              "type": "string"
            },
            {
              "type": "null"
            }
          ],
          "default": null
        },
        "format": {
          "title": "Format",
          "anyOf": [
            {
              "type": "string"
            },
            {
              "type": "null"
            }
          ],
          "default": null
        }
      },
      "required": [
        "title",
        "year"
      ]
    },
    "WorkType": {
      "title": "WorkType",
      "description": "Represents the type of work referenced in a library card.",
      "type": "object",
      "properties": {
        "type": {
          "title": "Type",
          "type": "string",
          "enum": [
            "Dissertation or thesis",
            "Reference"
          ]
        }
      },
      "required": [
        "type"
      ]
    }
  }
}

